import { BrowserRouter, Route } from "react-router-dom";
import Navbar from "./components/Navbar";
import "./index.css";
import HomePage from "./pages/HomePage";
function App() {
  return (
    <>
      <Navbar />
      <BrowserRouter>

        <Route path="/" element={<HomePage />} />
      </BrowserRouter>
    </>
  );
}

export default App;
